sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        inputs = new JenkinsUtils().trimStringInputs(inputs);
        outputs.folder_path = inputs.folder_path;
        var parentPath = "";
        if (inputs.folder_path.length != 0) {
            inputs.folder_path = inputs.folder_path.replace(/^\/|\/$/g, '');
            var parents = inputs.folder_path.split('/');
            for (var i = 0; i < parents.length; i++) {
                if (!parentPath) {
                    parentPath = parents[i];
                } else {
                    parentPath += "/" + parents[i];
                }
            }
        }
        outputs.folder_path = "/job/" + parentPath.replaceAll('/', '/job/');
    } catch (e) {
        new JenkinsUtils().throwError('delete_folder');
    }
})(inputs, outputs);

